import {KernelConfig, KernelFunc, Rsqrt} from '@tensorflow/tfjs-core';
import {unaryKernelFunc} from '../kernel_utils/kernel_funcs_utils';
import {rsqrtImplCPU} from '../kernel_utils/shared';

const RSQRT = `return inversesqrt(x);`;

export const rsqrt =
    unaryKernelFunc({opSnippet: RSQRT, cpuKernelImpl: rsqrtImplCPU});

export const rsqrtConfig: KernelConfig = {
  kernelName: Rsqrt,
  backendName: 'webgl',
  kernelFunc: rsqrt as unknown as KernelFunc
};
